import * as actions from "../actionTypes";

const initalState = {
  profile: {},
  latestBlog: [],
  auth: false
};

export const userReducer = (state = initalState, action) => {
  switch (action.type) {
    case actions.AUTHENTICATED:
      return { ...state, auth: action.payload };
    default:
      return state;
  }
};
